cy.request('POST', "".concat(Cypress.config('apiUrl'), "/auth/user"), {
  firstName: 'adff',
  lastName: 'reee',
  email: 'ranom',
  password: 'Password1!'
}).then(function (response) {
  cy.request('PUT', "".concat(Cypress.config('apiUrl'), "/auth/user/").concat(response.body.id), {
    firstName: 'anewname'
  }).then(function (newResponse) {
    expect(newResponse.status).to.equal(200);
    cy.request('GET', "".concat(Cypress.config('apiUrl'), "/auth/user/").concat(response.body.id)).then(function (getRes) {
      console.log('THE GET RESPONSE____________________ \n\r\n' + getRes);
      expect(getRes.status).to.equal(200);
      expect(getRes.body.firstName).to.equal('anewname');
      cy.request('DELETE', "".concat(Cypress.config('apiUrl'), "/auth/user/").concat(response.body.id)).then(function (deleteRes) {
        expect(deleteRes.status).to.equal(200);
      });
    });
  });
});

